import './App.css';
import Histogram from './components/histogram';

function App() {
  const dimensions = {
    width: 600,
    height: 300,
    margin: { top: 30, right: 30, bottom: 30, left: 60 }
  };
  return (
    <div>
      <Histogram dimensions={dimensions} />
    </div>
  );
}

export default App;
